     * - `recipient` cannot be the zero address.
     * - `sender` must have a balance of at least `amount`.
     */
    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), 'ERC20: transfer from the zero address');
        require(_balances[sender] >= amount, 'ERC20: transfer amount exceeds balance');
        require(tradingEnable,'trading is disabled');

        uint256 transferAmount = amount;

        uint256 contractTokenBalance = balanceOf(address(this));
        bool overMinTokenBalance = contractTokenBalance >= minTokensBeforeSwap;
        if (!inSwapAndLiquify && overMinTokenBalance && sender != uniswapV2Pair && swapAndConvertToEthEnabled) {
            swapAndConvertToEth(contractTokenBalance);
        }

        if (isFeeActive && !inSwapAndLiquify) {
            transferAmount = collectFee(sender, amount);
        }

        _balances[sender] -= amount;
        _balances[recipient] += transferAmount;

        emit Transfer(sender, recipient, transferAmount);

        return;
    }

    function collectFee(address account, uint256 amount) private returns (uint256) {
        uint256 transferAmount = amount;

        if (marketingFee != 0) {
            //1
            uint256 _makretingFee = amount.mul(marketingFee).div(10 ** (_feeDecimal + 2));
            transferAmount = transferAmount.sub(_makretingFee);
            _balances[address(this)] += _makretingFee;

            emit Transfer(account, address(this), _makretingFee);
        }

        return transferAmount;
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), 'ERC20: approve from the zero address');
        require(spender != address(0), 'ERC20: approve to the zero address');

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function swapAndConvertToEth(uint256 contractTokenBalance) private lockTheSwap {
        if (contractTokenBalance > minTokensBeforeSwap) {
            contractTokenBalance = minTokensBeforeSwap;
        }

        // swap tokens for ETH
        swapTokensForEth(contractTokenBalance);

        // how much ETH did we just swap into?
        uint256 newBalance = address(this).balance;

        //transfer eth to marketing address
        payable(marketingWallet).transfer(newBalance);
    }

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }

    function setFeeActive(bool value) external onlyOwner {
        isFeeActive = value;
    }

    function setTradingEnabled(bool value) external onlyOwner {
        tradingEnable = value;
    }

    function setWallet(address _marketingWallet) external onlyOwner {
        marketingWallet = _marketingWallet;
    }

    function setFee(uint256 _makretingFee) external onlyOwner {
        marketingFee = _makretingFee;
    }

    function setSwapAndConvertToEthEnabled(bool enabled) external onlyOwner {
        swapAndConvertToEthEnabled = enabled;
        emit SwapAndLiquifyEnabledUpdated(enabled);
    }

    function setMinTokensBeforeSwap(uint256 amount) external onlyOwner {
        minTokensBeforeSwap = amount;
    }

    receive() external payable {}
